webpackJsonp([0xdec76ddf799c],{2668:function(n,i){n.exports={pathContext:{docHtml:"<h1>Growl for nodejs</h1>\n<p><a href=\"https://travis-ci.org/tj/node-growl\"><img src=\"https://travis-ci.org/tj/node-growl.svg?branch=master\" alt=\"Build Status\"></a></p>\n<p>Growl support for Nodejs. This is essentially a port of my <a href=\"http://github.com/visionmedia/growl\">Ruby Growl Library</a>. Ubuntu/Linux support added thanks to <a href=\"http://github.com/niftylettuce\">@niftylettuce</a>.</p>\n<h2>Installation</h2>\n<h3>Install</h3>\n<h3>Mac OS X (Darwin):</h3>\n<p>  Install <a href=\"http://growl.info/extras.php#growlnotify\">growlnotify(1)</a>. On OS X 10.8, Notification Center is supported using <a href=\"https://github.com/alloy/terminal-notifier\">terminal-notifier</a>. To install:</p>\n<pre><code>$ sudo gem install terminal-notifier\n</code></pre>\n<p>  Install <a href=\"http://npmjs.org/\">npm</a> and run:</p>\n<pre><code>$ npm install growl\n</code></pre>\n<h3>Ubuntu (Linux):</h3>\n<p>  Install <code>notify-send</code> through the <a href=\"http://packages.ubuntu.com/libnotify-bin\">libnotify-bin</a> package:</p>\n<pre><code>$ sudo apt-get install libnotify-bin\n</code></pre>\n<p>  Install <a href=\"http://npmjs.org/\">npm</a> and run:</p>\n<pre><code>$ npm install growl\n</code></pre>\n<h3>Windows:</h3>\n<p>  Download and install <a href=\"http://www.growlforwindows.com/gfw/default.aspx\">Growl for Windows</a></p>\n<p>  Download <a href=\"http://www.growlforwindows.com/gfw/help/growlnotify.aspx\">growlnotify</a> - <strong>IMPORTANT :</strong> Unpack growlnotify to a folder that is present in your path!</p>\n<p>  Install <a href=\"http://npmjs.org/\">npm</a> and run:</p>\n<pre><code>$ npm install growl\n</code></pre>\n<h2>Examples</h2>\n<p>Callback functions are optional</p>\n<pre><code class=\"language-javascript\">var growl = require('growl')\ngrowl('You have mail!')\ngrowl('5 new messages', { sticky: true })\ngrowl('5 new emails', { title: 'Email Client', image: 'Safari', sticky: true })\ngrowl('Message with title', { title: 'Title'})\ngrowl('Set priority', { priority: 2 })\ngrowl('Show Safari icon', { image: 'Safari' })\ngrowl('Show icon', { image: 'path/to/icon.icns' })\ngrowl('Show image', { image: 'path/to/my.image.png' })\ngrowl('Show png filesystem icon', { image: 'png' })\ngrowl('Show pdf filesystem icon', { image: 'article.pdf' })\ngrowl('Show pdf filesystem icon', { image: 'article.pdf' }, function(err){\n  // ... notified\n})\n</code></pre>\n<h2>Options</h2>\n<ul>\n<li>\n<p>title</p>\n<ul>\n<li>notification title</li>\n</ul>\n</li>\n<li>\n<p>name</p>\n<ul>\n<li>application name</li>\n</ul>\n</li>\n<li>\n<p>priority</p>\n<ul>\n<li>priority for the notification (default is 0)</li>\n</ul>\n</li>\n<li>\n<p>sticky</p>\n<ul>\n<li>weither or not the notification should remainin until closed</li>\n</ul>\n</li>\n<li>\n<p>image</p>\n<ul>\n<li>\n<p>Auto-detects the context:</p>\n<ul>\n<li>path to an icon sets --iconpath</li>\n<li>path to an image sets --image</li>\n<li>capitalized word sets --appIcon</li>\n<li>filename uses extname as --icon</li>\n<li>otherwise treated as --icon</li>\n</ul>\n</li>\n</ul>\n</li>\n<li>\n<p>exec</p>\n<ul>\n<li>\n<p>manually specify a shell command instead</p>\n<ul>\n<li>appends message to end of shell command</li>\n<li>or, replaces <code>%s</code> with message</li>\n<li>optionally prepends title (example: <code>title: message</code>)</li>\n<li>examples: <code>{exec: 'tmux display-message'}</code>, <code>{exec: 'echo \"%s\" > messages.log}</code></li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n<h2>License</h2>\n<p>(The MIT License)</p>\n<p>Copyright (c) 2009 TJ Holowaychuk <a href=\"mailto:tj@vision-media.ca\">tj@vision-media.ca</a>\nCopyright (c) 2016 Joshua Boy Nicolai Appelman <a href=\"mailto:joshua@jbna.nl\">joshua@jbna.nl</a></p>\n<p>Permission is hereby granted, free of charge, to any person obtaining\na copy of this software and associated documentation files (the\n'Software'), to deal in the Software without restriction, including\nwithout limitation the rights to use, copy, modify, merge, publish,\ndistribute, sublicense, and/or sell copies of the Software, and to\npermit persons to whom the Software is furnished to do so, subject to\nthe following conditions:</p>\n<p>The above copyright notice and this permission notice shall be\nincluded in all copies or substantial portions of the Software.</p>\n<p>THE SOFTWARE IS PROVIDED 'AS IS', WITHOUT WARRANTY OF ANY KIND,\nEXPRESS OR IMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF\nMERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT.\nIN NO EVENT SHALL THE AUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY\nCLAIM, DAMAGES OR OTHER LIABILITY, WHETHER IN AN ACTION OF CONTRACT,\nTORT OR OTHERWISE, ARISING FROM, OUT OF OR IN CONNECTION WITH THE\nSOFTWARE OR THE USE OR OTHER DEALINGS IN THE SOFTWARE.</p>",docPath:"argo-ci/node_modules/growl/readme",proj:"argo-ci"}}}});
